import React from 'react'

function CollectionContainer(props){
    function RenderFreinds(){
        if(props.description.length == 0){
            const description = <li className="li-collection-desc">You do not have any {props.tag} yet.</li>
            return description
        }
        else{
            var arr= [];
            var arr2 = [];
            props.description.map(item=>{
                if( props.user[1] != item.owe_name && arr.indexOf(item.owe_name) === -1){
                    arr.push(item.owe_name)
                    arr2.push({name:item.owe_name,id:item.id})
                }    
            }) 
            const description = arr.map(item=>{
                for(let i in arr2){
                    if(item === arr2[i].name){
                        return <li className="li-collection" key={arr2[i].id} onClick={()=>{alert(arr2[i].id)}}><i className="fa fa-user"></i> {item}</li>
                    }
                }
            })
            return description
        }
    }


    return (
        <div className="collection">
            <div className="collection-top-wrap">
                <p>{props.name}</p>
                <div className="collection-margin"><a className="collection-a" href="">+ add</a></div>
            </div>
            <div className="collection-list">
                <ul className="ul-collection">
                    {description}
                </ul>
            </div>
        </div>
    );
}

export default CollectionContainer
